import{_ as t,o as d,c as A,R as e}from"./chunks/framework.7d7370a4.js";const r="/vitepress-demo/assets/CAN_12.0d1b0dda.png",p="data:image/png;base64,",n="/vitepress-demo/assets/anzhuang1.08b0236f.png",s="/vitepress-demo/assets/anzhuang2.5783e158.png",a="/vitepress-demo/assets/anzhuang3.d9e5e42f.png",i="/vitepress-demo/assets/anzhuang4.b57d9c62.png",o="/vitepress-demo/assets/mit_mode.1f5cb868.png",l="/vitepress-demo/assets/postion.00c4770a.png",b="/vitepress-demo/assets/speed.42d61f8d.png",c="/vitepress-demo/assets/show.78db3559.png",_=JSON.parse('{"title":"DAMIAO | 达妙科技","description":"","frontmatter":{},"headers":[],"relativePath":"product/dm4310/index.md","filePath":"product/dm4310/index.md","lastUpdated":null}'),h={name:"product/dm4310/index.md"},v=e('<h1 id="damiao-达妙科技" tabindex="-1"><strong>DAMIAO |</strong> 达妙科技</h1><p>DM-J4310-2EC减速电机</p><table><thead><tr><th>日期</th><th>版本</th><th>变更内容</th></tr></thead><tbody><tr><td>2022.10.14</td><td>V1.0</td><td>初版创建</td></tr></tbody></table><h2 id="注意事项" tabindex="-1">注意事项</h2><ul><li><p>请严格按照规定的工作环境及绕组最大允许温度范围使用电机，否则会对产品造成永久性不可逆转的损坏。</p></li><li><p>避免杂物进入转子内部，否则会导致转子运行异常。</p></li><li><p>使用前请检查各零部件是否完好。如有部件缺失、老化、损坏等，请停止使用。</p></li><li><p>确保正确接线，电机安装正确、稳固。</p></li><li><p>使用时勿触摸电子转子部分，避免意外发生。电机大扭矩输出时，会出现发热的情况，请注意避免烫伤。</p></li><li><p>用户请勿私自拆卸电机，否则会影响电机的控制精度，甚至会导致电机运行异常。</p></li></ul><h2 id="接口线序介绍" tabindex="-1">接口线序介绍</h2><h4 id="电源接口-含can通讯端子" tabindex="-1">电源接口（含CAN通讯端子）</h4><p><img src="'+r+'" alt="CAN_12"></p><ul><li><p>通过XT30(2+2)-F插头的电源连接线连接电源，额定电压为24V，为电机供电。</p></li><li><p>通过CAN通信端子连接外部控制设备，可接收CAN控制命令，反馈电机状态信息。</p></li><li><p>电机包含两个电源接口，任一接口可单独连接使用，也可多机串联使用，方便走线。</p></li></ul><h4 id="调试串口-3" tabindex="-1">调试串口-3</h4><p><img src="'+p+'" alt="gh125"></p><p>通过GH1.25连接线-3pin，使用USB转CAN调试工具（或使用通用USB转串口模块）连接到PC，通过达妙科技调试助手对电机进行参数设置，以及固件升级等。</p><h2 id="电机尺寸及安装" tabindex="-1">电机尺寸及安装</h2><p>请参考电机安装孔尺寸和位置将电机安装到对应设备。</p><p><img src="'+n+'" alt="anzhuang1"></p><p><img src="'+s+'" alt="anzhuang2"></p><p><img src="'+a+'" alt="anzhuang3"></p><p><img src="'+i+'" alt="anzhuang4"></p><h2 id="指示灯状态" tabindex="-1">指示灯状态</h2><table><tr><td rowspan="2">正常状态</td><td>绿灯常亮</td><td>使能模式，正常工作状态</td></tr><tr><td>红灯常亮</td><td>失能模式</td></tr><tr><td rowspan="1">异常状态</td><td>红灯闪烁</td><td>表示故障，对应故障类型为： <br> 8——超压； 9——欠压； <br> A——过电流； B——MOS过温； <br> C——电机线圈过温； D——通讯丢失； <br> E——过载 <br> 可通过反馈帧，或通过达妙科技调试助手界面显示，查看发生何种故障。 </td></tr></table><h3 id="工作模式" tabindex="-1">工作模式</h3><h4 id="mit模式" tabindex="-1">MIT模式</h4><p>​ MIT模式是为了兼容原版MIT模式所设计，可以在实现无缝切换的同时，能够灵活设定控制范围（P_MAX,V_MAX，T_MAX），电调将接收到的CAN数据转化成控制变量进行运算得到扭矩值作为电流环的电流给定，电流环根据其调节规律最终达到给定的扭矩电流。其控制示意框图如下：</p><p><img src="'+o+'" alt="mit_mode"></p><p>​ 根据MIT模式可以衍生出多种控制模式，如kp=0,kd不为0时，给定v_des即可实现匀速转动;kp=0,kd=0，给定t_ff即可实现给定扭矩输出。</p><p>​ <em>注意：对位置进行控制时，kd<strong>不能赋0</strong>，否则会造成电机震荡，甚至失控。</em></p><h4 id="位置速度模式" tabindex="-1">位置速度模式</h4><p>​ 位置串级模式是采用三环串联控制的模式，位置环作为最外环，其输出作为速度环的给定，而速度环的输出作为内环电流环的给定，用以控制实际的电流输出，其控制示意框图见下图：</p><p><img src="'+l+'" alt="postion"></p><p>​ p_des为控制的目标位置，v_des是用来限定运动过程中的最大绝对速度值。位置串级模式如使用调试助手推荐的控制参数控制，可以达到较好的控制精度，控制过程相对柔顺，但响应时间相对较长。可配置的相关参数除v_des外，另有加/减速度进行设定，如控制过程中产生额外的震荡可提高加/减速度。</p><p><em>注意：p_des，v_des单位分别为rad和rad/s，数据类型为float，阻尼因子必须设置为<strong>非0</strong>的正数，可参考速度模式的注意事项。</em></p><h4 id="速度模式" tabindex="-1">速度模式</h4><p>​ 速度模式能让电机稳定运行在设定的速度，其控制示意框图如下：</p><p><img src="'+b+'" alt="speed"></p><ul><li>​ 注意：v_des<strong>单位为rad/s</strong>，数据类型为float**，如需使用调试助手自动计算参数，则需要设置阻尼因子为非0<strong>正数，通常情况下取值在2.0~10.0</strong>，过小的阻尼因子会带来速度的震荡以及较大的过冲，过大的阻尼因子则会带来较长的上升时间，推荐的设定值为4.0**。</li></ul><h2 id="使用" tabindex="-1">使用</h2><p>​ 控制使用CAN标准帧格式，固定波特率为1Mbps，按功能可分为接收帧和反馈帧，接收帧为接收到的控制数据，用于实现对电机的命令控制；反馈帧为电机向上层控制器发送电机的状态数据。根据电机选定的不同模式，其接收帧帧格式定义以及帧ID各不相同，但各种模式下的反馈帧是相同的。</p><h3 id="反馈帧" tabindex="-1">反馈帧</h3><p>​ 反馈帧ID由调试助手设置（Master ID），默认为0，主要反馈电机的位置，速度和扭矩信息，其帧格式定义为：</p><table><thead><tr><th>反馈报文</th><th>D[0]</th><th>D[1]</th><th>D[2]</th><th>D[3]</th><th>D[4]</th><th>D[5]</th><th>D[6]</th><th>D[7]</th></tr></thead><tbody><tr><td>MST_ID</td><td>ID|ERR&lt;&lt;4</td><td>POS[15:8]</td><td>POS[7:0]</td><td>VEL[11:4]</td><td>VEL[3:0]|T[11:8]</td><td>T[7:0]</td><td>T_MOS</td><td>T_Rotor</td></tr></tbody></table><p>其中：</p><p>ID表示控制器的ID，取CAN_ID的低8位</p><p>ERR表示故障，对应故障类型为：</p><p>8——超压；</p><p>9——欠压；</p><p>A——过电流；</p><p>B——MOS过温；</p><p>C——电机线圈过温；</p><p>D——通讯丢失；</p><p>E——过载；</p><p>POS表示电机的位置信息</p><p>VEL表示电机的速度信息</p><p>T表示电机的扭矩信息</p><p>T_MOS表示驱动上MOS的平均温度，单位℃</p><p>T_Rotor表示电机内部线圈的平均温度，单位℃</p><p>位置、速度和扭矩采用线性映射的关系将浮点型数据转换成有符号的定点数据，其中位置采用16位数据，速度和扭矩均使用12位。</p><h3 id="mit模式下控制帧" tabindex="-1">MIT模式下控制帧</h3><table><thead><tr><th>控制报文</th><th>D[0]</th><th>D[1]</th><th>D[2]</th><th>D[3]</th><th>D[4]</th><th>D[5]</th><th>D[6]</th><th>D[7]</th></tr></thead><tbody><tr><td>ID</td><td>p_des[15:8]</td><td>p_des[7:0]</td><td>v_des[11:4]</td><td>v_des[3:0]|Kp[11:8]</td><td>Kp[7:0]</td><td>Kd[11:4]</td><td>Kd[3:0]|t_ff[11:8]</td><td>t_ff[7:0]</td></tr></tbody></table><p>帧ID等于设定的CAN ID值</p><p>​ P_des：位置给定</p><p>​ V_des：速度给定</p><p>​ Kp：位置比例系数</p><p>​ Kd：位置微分系数</p><p>​ T_ff：转矩给定值</p><p>​ 各参数符合上一节的映射关系，其中p_des,v_des,t_ff的范围可由调试助手进行设定，Kp的范围为[0,500]，Kd的范围为[0,5]。</p><p>​ 标准CAN数据一帧只有8个字节，MIT的控制命令格式将Position、Velocity、Kp、Kd、Torque五个参数按位组合在8个字节中。其中：Position占用2个字节16位、Velocity占用12位、Kp占用12位、Kd占用12位。</p><table><tr><td align="center">控制报文</td><td align="center">D[0]</td><td align="center">D[1]</td><td align="center">D[2]</td><td align="center">D[3]</td><td align="center">D[4]</td><td align="center">D[5]</td><td align="center">D[6]</td><td align="center">D[7]</td></tr><tr><td align="center">0x100+ID</td><td colspan="4" align="center">p_des</td><td colspan="4" align="center">v_des</td></tr></table><p>​ 帧ID为设定的CAN ID值加上0x100的偏移</p><p>​ <strong>P_des</strong>：位置给定，浮点型，低位在前，高位在后</p><p>​ <strong>V_des</strong>：速度给定，浮点型，低位在前，高位在后</p><p>​ 此处发送命令的CAN ID是0x100+ID。速度给定是梯形加速度运行下最高速度的，即为匀速段的速度值。</p><h3 id="速度模式下控制帧" tabindex="-1">速度模式下控制帧</h3><table><tr><td align="center">控制报文</td><td align="center">D[0]</td><td align="center">D[1]</td><td align="center">D[2]</td><td align="center">D[3]</td></tr><tr><td align="center">0x200+ID</td><td colspan="4" align="center">v_des</td></tr></table><p>​ 帧ID为设定的<strong>CAN ID</strong>值加上0x200的偏移</p><p>​ <strong>V_des</strong>：速度给定，浮点型，低位在前，高位在后</p><p>​ 此处发送命令的CAN ID是<em>0x200+ID。</em></p><h2 id="使用达妙科技调试助手" tabindex="-1">使用达妙科技调试助手</h2><p>​ 使用达妙科技USB转CAN调试工具，连接电脑和电机，通过达妙科技助手对电机进行参数设置以及固件升级。</p><p>​ 电机调试串口通过GH1.25连接线-3pin连接PC，电机电源接口中CAN通信端子通过XT30(2+2)-F插头连接线连接USB转CAN调试工具，通过达妙科技调试助手对电机进行参数设置，以及固件升级等。</p><p>​ 电机的串口、CAN口以及电源接口连通后，电脑端打开达妙科技调试助手，选择相应的串口设备并打开串口。此时给电机供电，串口会打印信息，Control Mode指示当前驱动模式。</p><h2 id="电机参数" tabindex="-1">电机参数</h2><p>​ 定速120rpm，室温25℃下，测得的性能曲线图：</p><p><img src="'+c+'" alt="show"></p><h2 id="特征参数" tabindex="-1">特征参数</h2><table><tr><td rowspan="7">电机参数</td><td>额定电压</td><td>24V</td></tr><tr><td>额定电流</td><td>2.5A</td></tr><tr><td>峰值电流</td><td>7.5A</td></tr><tr><td>额定扭矩</td><td>3NM</td></tr><tr><td>峰值扭矩</td><td>7NM</td></tr><tr><td>额定转速</td><td>120rpm</td></tr><tr><td>空载最大转速</td><td>200rpm</td></tr><tr><td rowspan="4">电机特征值</td><td>减速比</td><td>10: 1</td></tr><tr><td>极对数</td><td>14</td></tr><tr><td>相电感</td><td>340uH</td></tr><tr><td>相电阻</td><td>650mΩ</td></tr><tr><td rowspan="3">结构与重量</td><td>外径</td><td>56mm</td></tr><tr><td>高度</td><td>46mm</td></tr><tr><td>电机重量</td><td>约300g</td></tr><tr><td rowspan="3">编码器</td><td>编码器位数</td><td>14位</td></tr><tr><td>编码器个数</td><td>2</td></tr><tr><td>编码器类型</td><td>磁编（单圈）</td></tr><tr><td rowspan="2">通讯</td><td>控制接口</td><td>CAN@1Mbps</td></tr><tr><td>调参接口</td><td>UART@921600bps</td></tr><tr><td rowspan="9">控制与保护</td><td rowspan="3">控制模式</td><td>MIT模式</td></tr><tr><td>速度模式</td></tr><tr><td>位置模式</td></tr><tr><td rowspan="6">保护</td><td>驱动过温防护，防护温度：120℃，过温电机将退出“使能模式”</td></tr><tr><td>电机过温防护，根据使用需求设定，建议不超过100℃，过温电机将退出“使能模式”</td></tr><tr><td>电机过压防护，根据使用需求设定，建议不超过32V，过压将退出“使能模式”</td></tr><tr><td>通讯丢失防护，设定周期内没有收到CAN指令将自动退出“使能模式”</td></tr><tr><td>电机过流防护，根据使用需求设定，建议不超过9.8A，过流将退出“使能模式”</td></tr><tr><td>电机欠压防护，若电源电压低于设定值，则退出“使能模式”，电源电压不低于15V</td></tr></table>',85),f=[v];function m(u,g,x,N,D,T){return d(),A("div",null,f)}const X=t(h,[["render",m]]);export{_ as __pageData,X as default};
